Problem 3: Transactional Memory
The following code sequence attempts to use transactional memory to update a location in memory, and
falls back on a lock when conflicts are detected; however, it has a flaw where updates can be lost. Please
explain the flaw and how the code can be updated to prevent it.
Recall that the expression \*loc += val is three instructions in x86 assembly. Note that if the transaction
fails, execution rolls back to the xbegin() call with an ABORT return value.
void atomic\_add(int\* loc, int val)
{
int result = xbegin();
if (result == SUCCESS)
{
\*loc += val;
xend();
}
else
{
lock();
\*loc += val;
unlock();
}
}

